        super();
        this.state = {
            teamName : "",
            teamMembers : []
        }
    }



    componentDidMount() {
        if(this.props.teamName == "RA") {
            this.setState({teamName : this.props.teamName});

            // find the right file
            axios.get('http://localhost:3001/../static/data/Mydata.json')
                .then(response => {
                console.log(response.data)
                this.setState({lists: response.data})
                })
        }
        console.log(this.state.teamMembers);
    }



    render() {

        return(
            <div>
                <h1 id="text-danger">{this.state.teamName}</h1>
                <h1 id="text-danger">{this.raTeamMembers.team}</h1>
